import React from "react";
import "./Bus.css";

const bus = props => {
  return (
    <div className="Bus">
      <p>Numer autobusu: {props.routeId}</p>
      <p>Kierunek: {props.headsign}</p>
      <p>Czas przyjazdu: {props.estimatedTime}</p>
      <p>Czas rozkladowy: {props.theoreticalTime}</p>
    </div>
  );
};


const getEstimatedInMinutes = (est) => {
    return "Za 8 minut";
}
export default bus;
